import { Fragment } from "react";
import { v4 as uuidv4 } from "uuid";

import style from "./SearchListItem.module.css";
import ExpenseItem from "../../../Home/Daily/ExpenseItem";

const EXPENSE_DATA = [
  {
    category: "expense",
    mainCate: "food",
    subCate: "breakfast",
    time: "18 June, 20",
    description: "Burger",
    money: "50",
  },
  {
    category: "expense",
